import { collection, addDoc, getDocs, doc, setDoc } from 'firebase/firestore';
import { db } from './firebase';

const checkDataSeeded = async () => {
  // Check if the 'seedStatus' document exists in the 'metadata' collection
  const metadataRef = doc(db, 'metadata', 'seedStatus');
  const metadataSnapshot = await getDocs(metadataRef);

  return metadataSnapshot.exists();
};

const seedData = async () => {
  // Check if data is already seeded
  const isDataSeeded = await checkDataSeeded();

  if (!isDataSeeded) {
    // Data is not seeded, proceed with seeding
    const vehiclesCollection = collection(db, 'vehicles');
    const vehiclesData = [
      // ... (your vehicle data)
    ];
    for (const vehicle of vehiclesData) {
      await addDoc(vehiclesCollection, vehicle);
    }

    // Update the 'seedStatus' document to indicate that data has been seeded
    const metadataRef = doc(db, 'metadata', 'seedStatus');
    await setDoc(metadataRef, { seeded: true });

    console.log('Data seeded successfully.');

    // Return true to indicate that data was seeded
    return true;
  } else {
    console.log('Data is already seeded.');

    // Return false to indicate that data was not seeded (already seeded)
    return false;
